const SortArticles = () => {
  return (
    <form>
      Sort Articles By <br />
      <label>
        DATE
        <input
          type="checkbox"
          name="date"
          value="Date"
          onClick={event => handleCheck(event)}
        />
      </label>{" "}
      <br />
      <label>
        Comments
        <input type="checkbox" name="comment_count" value="Comments" />
      </label>
      <br />
      <label>
        Votes
        <input type="checkbox" name="votes" value="Votes" />
      </label>
    </form>
  );
};

const handleCheck = event => {
  console.log(event.name);
};

export default SortArticles;
